stateMachine.definition:
{
  "Comment": "three lambda functions for image classifier",
  "StartAt": "Lambda1-DataGeneration",
  "States": {
    "Lambda1-DataGeneration": {
      "Type": "Task",
      "Resource": "arn:aws:states:::lambda:invoke",
      "OutputPath": "$.Payload",
      "Parameters": {
        "FunctionName": "arn:aws:lambda:us-west-2:495022547570:function:L1SerializeImageData:$LATEST",
        "Payload": {
          "image_data": "",
          "s3_bucket": "sagemaker-us-west-2-495022547570",
          "s3_key": "test/bicycle_s_000513.png",
          "inferences": []
        }
      },
      "Next": "Lambda2-ImageClassification"
    },
    "Lambda2-ImageClassification": {
      "Type": "Task",
      "Resource": "arn:aws:states:::lambda:invoke",
      "OutputPath": "$.Payload",
      "Parameters": {
        "Payload.$": "$",
        "FunctionName": "arn:aws:lambda:us-west-2:495022547570:function:L2ImageClassification:$LATEST"
      },
      "Next": "Lambda3-Filtering"
    },
    "Lambda3-Filtering": {
      "Type": "Task",
      "Resource": "arn:aws:states:::lambda:invoke",
      "OutputPath": "$.Payload",
      "Parameters": {
        "Payload.$": "$",
        "FunctionName": "arn:aws:lambda:us-west-2:495022547570:function:L3FilterOutLowQuality:$LATEST"
      },
      "End": true
    }
  }
}
